import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Route } from 'react-router';


function App() {
    return (
      <div className="App">
        <Router>
          <Navbar />
          <Switch>
            <Route path='/'/>
          </Switch>
        </Router>
      </div>
    );
}

export default App;
